function isValidHost(urlString) {
  const url = new URL(urlString);
  return url.hostname === 'secure.ssa.gov';
}

function gotoSSA() {
  const { redirect } = Host.getFunctions();
  const mem = Memory.fromString('https://secure.ssa.gov/myssa/myprofile-ui/main');
  redirect(mem.offset);
}

function start() {
  if (!isValidHost(Config.get('tabUrl'))) {
    gotoSSA();
    Host.outputString(JSON.stringify(false));
    return;
  }
  Host.outputString(JSON.stringify(true));
}

function two() {
  const cookies = JSON.parse(Config.get('cookies'))['secure.ssa.gov'];
  const headers = JSON.parse(Config.get('headers'))['secure.ssa.gov'];
  if (
    !cookies['PD-ID']
  ) {
    Host.outputString(JSON.stringify(false));
    return;
  }

  const cookiesString = Object.entries(cookies)
    .map(([key, value]) => `${key}=${value}`)
    .join(";");

  Host.outputString(
    JSON.stringify({
      url: 'https://secure.ssa.gov/myssa/myprofile-api/profileInfo',
      method: 'GET',
      headers: {
        Host: 'secure.ssa.gov',
        Cookie: `${cookiesString}`,
        Connection: 'close'
      }
    }),
  );
}

function three() {
  const params = JSON.parse(Host.inputString());
  const { notarize } = Host.getFunctions();

  if (!params) {
    Host.outputString(JSON.stringify(false));
  } else {
    const mem = Memory.fromString(JSON.stringify(params));
    const idOffset = notarize(mem.offset);
    const id = Memory.find(idOffset).readString();
    Host.outputString(JSON.stringify(id));
  }
}

function config() {
  Host.outputString(
    JSON.stringify({
      title: 'SSA Profile',
      description: 'Notarize ownership of a Social Security profile',
      icon: 'data:image/png;base64,',
      steps: [
        {
          title: 'Visit SSA website',
          cta: 'Go to ssa.gov',
          action: 'start',
        },
        {
          title: 'Collect credentials',
          description: "Login to your account if you haven't already",
          cta: 'Check cookies',
          action: 'two',
        },
        {
          title: 'Notarize SSA profile',
          cta: 'Notarize',
          action: 'three',
          prover: true,
        },
      ],
      hostFunctions: ['redirect', 'notarize'],
      cookies: ['secure.ssa.gov'],
      headers: ['secure.ssa.gov'],
      requests: [
        {
          url: 'https://secure.ssa.gov/myssa/myprofile-api/profileInfo',
          method: 'GET',
        },
      ],
    }),
  );
}

module.exports = { start, config, two, three };
